import './Input.css'
import Box from '@mui/material/Box';
export const Input = ({type,placeholder}) => 
{
return(<Box sx={{
    background:"#f3ecb059",
    boxshadow: "0 8px 32px 0 rgba(32, 38, 135, 1.37)",
    borderRadius:"2rem",
    width: "80%",
    height:"3rem ",
    padding:"1rem",
    border:"none",
    outline: "auto",
    }}> 
    <Input type="text" placeholder="Email"/>
    <Input type="password" placeholder="password"/>
     </Box>
);


}
